css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("wykop.pl"), 
domain("www.wykop.pl"),
url("http://www.wykop.pl/")  
{

	*
	{
        font-family: Times New Roman !important; 
        font-size: 12px !important; 
        color: #000 !important;
        background: none !important; 
        text-decoration: none !important;
    }

    body
        {
        background: #d7d2ca url("data:image/png;base64,") no-repeat 50px 20px !important;
    }

    .wrapper
        {
        width: auto !important;
    }

    #content
        {
        width: 558px !important; 
        margin: 32px 0px 150px 163px !important;
        padding: 50px 127px 0 10px !important;
        height: 659px !important;
		overflow-x: hidden !important;
		overflow-y: scroll !important;
    }

	#main-list
	{
		margin: -35px 455px 0px 590px !important;
		padding: 5px 0px 0px 0px !important;
		width: 242px !important;
		height: 20px !important;
	}

	#main-list *
	{
		font-family: Arial !important;
		color: #15428B !important;
		font-size: 11px !important;
		font-weight: normal !important;
		background-color: #BFDBFF !important;
		padding: -5px 0px 0px 0px !important;
		margin: -2px 0px 0px 5px !important;
	}    
    
	#sidebar,
    ul .cite img,
    #footer-container,
    .whatsnew,
    .image,
	#quick-login,
	#header-container form,
	#main-list li:nth-child(3),
	#main-list li:nth-child(4),
	#main-list li:nth-child(5),
	#main-list li:nth-child(6),
	#sub-list,
	#header-container div:nth-child(3),
	.sponsoredby,
	.box-rounded
	{
        display: none !important;
    }
    


}
